import React from 'react';
import styled from 'styled-components';

const ContainerStyle = styled.div`
    width: 400px;
    paddingTop: 20, 
    top: '20%', 
    left: '40%', 
    position: 'absolute', 
    paddingBottom: 20,
    color: 'white'
`;

export function Container({
    children
}) {
    return <ContainerStyle>{children}</ContainerStyle>
}
